import React from 'react';
import { Container, Conteudo } from './style';
import EventFeed from './EventFeed'; // Ajuste o caminho do import conforme necessário

function App() {
  return (
    <div>
      <h1>Feed de Eventos</h1>
      <EventFeed />
    </div>
  );
}

function Main() {
  return (
    <Container>
        <Conteudo>
        <div>
        <h1>Feed de Eventos</h1>
        <EventFeed />
        </div>
        </Conteudo>
    </Container>
  );
}

export default Main;
